import React from "react"
import "./Home.css"

export default function HomePage() {
    return(
        <ul className="navB">
            <li><a href="homepage"> דף הבית </a></li>
            <li><a href="playpage"> עמוד משחק </a></li>
            <li><a href="libery"> הספרייה שלי </a></li>
            <li><a href="history"> היסטוריה </a></li>
        </ul>
    )
}
